import React from "react";
import PropTypes from "prop-types";
import Link from "next/link";

const AppLayout = (props) => {
  console.log(props);
  return (
    <div>
      <div>Common Menu</div>
      {props.children}
    </div>
  );
};

AppLayout.propTypes = {
  children: PropTypes.node.isRequired,
};

export default AppLayout;
